from collections import deque

def generate_binary(n):
    q = deque()
    q.append(0)
    res = []
    for i in range(n):
        res.append(int(bin(q[0])[2:], 2))
        for _ in range(len(q)):
            x = q.popleft()
            if x!= (1 << i) - 1:
                q.append(x)
                q.append(x | (1 << i))
    return res
